import React, { useState, useEffect } from "react";

const Test = () => {
	const [count, setCount] = useState(0);

	const tick = () => {
		setCount(count + 1);
	};

	useEffect(() => {
		let interval = setInterval(tick, 1000);

		return () => {
			clearInterval(interval);
		};
	}, [count]);

	return (
		<div>
			<button>{count}</button>
		</div>
	);
};

export default Test;
